import { useEffect, useState } from "react";

export default function ContentDetails() {
  // const [search, setSearch] = useState([]);

  const [chosen, setChosen] = useState({});

  useEffect(() => {
    async function getData() {
      const res = await fetch(
        "https://api.jikan.moe/v4/anime?q=jujutsu kaisen&sfw"
      );
      const data = await res.json();

      const myData = data.data[0];
      setChosen(data.data[0]);
      console.log(myData);
    }
    getData();
  }, []);
  console.log(chosen);
  return (
    <div className="content-details-container">
      <div className="item-poster-box">
        <img
          src={"https://cdn.myanimelist.net/images/anime/1171/109222l.jpg"}
          alt="k"
        />
      </div>
      <Aside chosen={chosen} />
      <Status chosen={chosen} />
      <p className="item-description">{chosen?.synopsis}</p>
    </div>
  );
}

function Aside({ chosen }) {
  const producers = chosen?.producers
    ?.map((el) => el)
    .map((el) => el.name)
    .join(" , ");

  const licensors = chosen?.licensors
    ?.map((el) => el)
    .map((el) => el.name)
    .join(" , ");

  return (
    <div className="aside-item-box">
      <div className="aside-item">
        <span className="aside-item">Type: {chosen?.type}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Episodes: {chosen?.episodes}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Status: {chosen?.status}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Aired: {chosen?.aired?.string}</span>
      </div>
      {/* <div className="aside-item">
        <span className="aside-item">Premiered: {chosen[0]?.pr}</span>
      </div> */}
      <div className="aside-item">
        <span className="aside-item">Producers: {producers}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Licensors:{licensors}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Studios: {chosen?.studios[0]?.name}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Source: {chosen?.source}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Theme: {chosen?.themes[0]?.name}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">
          Demographic: {chosen?.demographics[0]?.name}
        </span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Duration: {chosen?.duration}</span>
      </div>
      <div className="aside-item">
        <span className="aside-item">Rating: {chosen?.rating}</span>
      </div>
    </div>
  );
}

function Status({ chosen }) {
  console.log(chosen);
  return (
    <div className="status-box">
      <div className="status-item-score-box">
        <p className="status-item-score">{chosen?.score}</p>
        <p className="status-item-score-users">Users: 2,093,317 </p>
      </div>
      <div className="status-item">
        <span className="status-item-type">Ranked</span>
        <p className="status-item-value">#{chosen?.rank}</p>
      </div>
      <div className="status-item">
        <span className="status-item-type">Popularity</span>
        <p className="status-item-value">#{chosen?.popularity}</p>
      </div>
      <div className="status-item">
        <span className="status-item-type">Members</span>
        <p className="status-item-value">{chosen?.members}</p>
      </div>
    </div>
  );
}
